import requests
import random
import time

def parse_fname(url):
    url = url.split('/')
    rand = random.randint(1,100000) # idc this is throw away code, < 1/100k chance of collision
    return str(rand) + "_" + url[-1]

def sort(url, txt):
    if("\"simulator lang=spectre" in txt):
        return "spectre_scripted"
    if("\'simulator lang=spectre" in txt):
        return "spectre_scripted"
    elif(".py" in url):
        return "spectre_scripted"
    elif(".jl" in url):
        return "spectre_scripted"
    elif(".md" in url):
        return "spectre_scripted"
    elif(".html" in url):
        return "spectre_scripted"
    if("simulator lang=spectre" in txt):
        return "spectre"
    else:
        # Should never happen
        return "other"

